// DoctorsList.jsx
import React, { useEffect, useState } from "react";

const DoctorsList = () => {
  const [doctors, setDoctors] = useState([]);
  const token = localStorage.getItem("token");

  useEffect(() => {
    const fetchDoctors = async () => {
      try {
        const response = await fetch(
          "https://ahd.instapract.ae/web/api/doctor/doc-list",
          {
            method: "GET",
            headers: {
              "Content-Type": "application/json",
              "APPID": "Gem3s12345",
              Authorization: `Bearer ${token}`,
            },
          }
        );

        const data = await response.json();
        console.log("Doctors List:", data);
        setDoctors(data.data || []);
      } catch (error) {
        console.error("Error fetching doctors:", error);
      }
    };

    fetchDoctors();
  }, [token]);

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Doctors List</h2>
      <ul className="space-y-2">
        {doctors.map((doc, index) => (
          <li key={index} className="p-3 border rounded shadow">
            {doc.name || "Doctor Name"} - {doc.speciality || "Speciality"}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default DoctorsList;
